import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "../context/auth.provider";
import { RouterPerson } from "../../person/module/person.routes";
import { RouterLogin } from "../../login/module/login.routes";
import { IndexLoginHtml } from "../../login/components";
export const RoutesHtml = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/">
            <Routes>
              <Route path="/" element={<IndexLoginHtml />} />
            </Routes>
          </Route>
          <Route element={<RouterPerson />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};
